---------------------- Truncate data of all tables ----------------------
DO $$
BEGIN
    EXECUTE (
        SELECT 'TRUNCATE TABLE ' || string_agg(format('%I.%I', schemaname, tablename), ', ') || ' CASCADE'
        FROM pg_tables
        WHERE schemaname = 'public'
    );
END $$;



SELECT pg_catalog.setval('public.timesheets_id_seq', 382, true);